import React from "react";

function Card(){
    return(
        <>
            <div className="products">
                <div className="product">
                    <img />
                    <div className="product_info">
                        <h3></h3>
                        <h5></h5>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Card;
